import React from 'react';
import './home.css';
import imgme from '../../Assets/photoofme.png';
import Typewriter from '../../Assets/Typewriter/typewriter';
import { ReactTyped } from 'react-typed';
import { Link } from 'react-scroll';
import mousescr from '../../Assets/mouse-cursor.png';

function Home(){
  return (
    <section id="intro">
      <div className="rectbox">
        <div className="imgcontainer">
        <img src={imgme} alt="Me" className="photoofme" />
        </div>
        <span className="nameinbox">RUDRAKSHA SINGH</span>
        <span className="webdevtxt"><ReactTyped strings={[">Front End Developer"]} typeSpeed={100} loop/> </span>
      </div>
      <Link className="scrolldown"><script src="https://unpkg.com/@dotlottie/player-component@latest/dist/dotlottie-player.mjs" type="module"></script><dotlottie-player src={'https://lottie.host/f5e6d678-ffe7-4492-a93d-04f6e67191af/wvC2Glogm1.json'} background="transparent" speed="1" style="width: 300px; height: 300px" direction="1" playMode="normal" loop controls autoplay></dotlottie-player><img src={mousescr} alt="mouseicon" className='scrollingmouse' />Scroll Down</Link>
    </section>
  );
}

export default Home;
